import React from 'react'
import "./CategoryCard.scss"
import {Link} from 'react-router-dom'

const CategoryCard = ({item}) => {
  return (
    <Link className='link' to = {'/category/${category.id}'}>
    <div className='categoryCard'>
    <h2>{item.category}</h2>
    </div>
    </Link>
    
  )
}

export default CategoryCard
